  false,\n\t\"url\": null,\n\t\"notes\": \"Spectrum Mapping was tasked by ENSR International
  (now a subsidiary of AECOM Technology Corporation) to collect LIDAR data and digital
  ortho imagery to generate breaklines and a bare earth DEM to support 2-foot contour
  intervals in accordance with FEMA Appendix A. The project area for Connecticut River
  floodplain was approximately 143 square miles in Hampden County, Massachusetts.
  The Spectrum aircraft was equipped with the RAMS system, including a 26 Khz Laser,
  an inertial measurement unit (IMU), and a dual frequency GPS receiver and antenna.
  The RAMS sensor system also includes a RAMS 4K X 4K color digital camera mounted
  to the LIDAR unit.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
